        // regUser();
        // console.log("Username:", username, "Password:", password, "Email:", email, "First Name:", firstName, "Last Name:", lastName, "Photo URL:", photoUrl);
        //navigate('/goals');
    }
  return (
    <>
        <form onSubmit={registerSubmit}>
        <label>Username:
            <input type='text' value={username} onChange={(e:any) => setUsername(e.target.value)}/>
        </label><br/>

        <label>Password:
            <input type='password' value={password} onChange={(e:any) => setPassword(e.target.value)}/>
        </label><br/>

        <label>Email:
            <input type='text' value={email} onChange={(e:any) => setEmail(e.target.value)}/>
        </label><br/>

        <label>First Name:
            <input type='text' value={first_name} onChange={(e:any) => setFirstName(e.target.value)}/>
        </label><br/>

        <label>Last Name:
            <input type='text' value={last_name} onChange={(e:any) => setLastName(e.target.value)}/>
        </label><br/>

        <label>Photo URL:
            <input type='text' value={photo_url} onChange={(e:any) => setPhotoUrl(e.target.value)}/>
        </label><br/>

        <button type='submit'>Submit</button>
        </form>
    </>
  )
}

